import React from 'react'
import Item from './Item'

function ListaItems({_info, appUpdateText}) {


  function appUpdateTextList(id,texto){
    appUpdateText(id,texto)
  }


  return (
    <div>
    {
        _info.map((element) => (
            <Item key={element.id} _item={element} appUpdateTextList={appUpdateTextList} />
        ))
    }
    </div>
  )
}

export default ListaItems
